func main() {
   const limit = 65535
   for portD := 1; portD<limit; portD++ {
      address := fmt.Sprintf("127.0.0.1:%d", portD)
      conn, err := net.Dial("tcp", address)
      if err != nil {
         continue // Nothing is listening Recheck next port
      }
      conn.Close()
      fmt.Printf("Listening port %d:\n", portD)
   }
}
